	/**
	 * 238. 除自身以外数组的乘积
	 *  采用 左边乘积 × 右边乘积
	 * @param nums
	 * @return
	 */
	public int[] productExceptSelf(int[] nums) {
		int len = nums.length;
		int[] rst = new int[nums.length];
		int k = 1;
		for(int i=0; i<len; i++) {
			rst[i] = k;
			k *= nums[i];
		}
		
		k = 1;
		for(int i=len-1; i>=0; i--) {
			rst[i] *= k;
			k *= nums[i];
		}
		return rst;
	}

